Entry.Value:
int gr=20;

public override void Init() {
  base.Init();

  additionalPointInfo=new AdditionalPointInfo();
  para1=GetDouble("Formula.Universal.Para1");
  para2=GetDouble("Formula.Universal.Para2");
  para3=GetDouble("Formula.Universal.Para3");
  para4=GetDouble("Formula.Universal.Para4");
  para5=GetDouble("Formula.Universal.Para5");
  para6=GetDouble("Formula.Universal.Para6");
  para7=GetDouble("Formula.Universal.Para7");
  para8=GetDouble("Formula.Universal.Para8");
  para9=GetDouble("Formula.Universal.Para9");
}

double para1=0.5;
double para2=1;
double para3=2;
double para4=0.5;
double para5=0.5;
double para6=1;
double para7=2;
double para8=0.5;
double para9=0.5;

public override long InSet(double ar, double ai, double aj, double br, double bi, double bj, double bk, long zkl, bool inverse) {

  double aar, aai, aaj, d; 
  long tw;
  int n;

  additionalPointInfo.red=0;
  additionalPointInfo.green=0;
  additionalPointInfo.blue=0;

  aar = ar * ar; aai = ai * ai; aaj = aj * aj;tw = 0;
  d = aar + aai + aaj;

  for (n = 1; n < zkl; n++) {

    ai = para1 * ai * aj *ar;
    aj =para2* aaj + para3*aai + para4*aar;
    ar =para5* aar + para6*aai + para7*aaj;

    ar+=br;
    ai+=bi;
    aj+=bj;

    aar = ar * ar; aai = ai * ai; aaj = aj * aj;
    d = aar + aai + aaj;

    if(d>0) {
      additionalPointInfo.red=aar/d;
      additionalPointInfo.green=aai/d;
      additionalPointInfo.blue=aaj/d;
    }

    if ((d) > gr) { tw = n; break; }
  }

  if (inverse) {
     if (tw == 0)
        tw = 1;
     else
        tw = 0;
  }

  return (tw);

}
